def getNewCoords(coords, buildingHeight, date, lon, lat):
  res = get_times(date, lon, lat)
  allNewCoords = []

  sunrise = res['sunrise_end']
  sunset = res['sunset_start']
  time_diff = sunset - sunrise
  num_points = 5
  datetime_list = [sunrise + time_diff * i / (num_points - 1) for i in range(num_points)]
  datetime_list.pop(0)
  datetime_list.pop()

  az = 0

  for time in datetime_list:
    #print(time)
    position = get_position(time, lon, lat)

    #skyAngle = 3.14159 / 4
    #cardinalAngle = 3.14159 / 4

    skyAngle = position['altitude']
    cardinalAngle = position['azimuth']

    #cardinalAngle = az

    az += 0.5

    shadowLength = buildingHeight / math.tan(skyAngle)
    xshift = shadowLength * math.cos(cardinalAngle)
    yshift = shadowLength * math.sin(cardinalAngle)

    newCoords = []

    for c in coord:
      newx = c[0] + xshift
      newy = c[1] + yshift
      newCoords.append((newx, newy))

    allNewCoords.append(newCoords)

  return allNewCoords


def showPolygonShadows(coord, height, ln, lt, file_path, output_file_path):
  image = plt.imread(file_path)
  fig, ax = plt.subplots(1, figsize=(8, 8))
  ax.imshow(image)
  coord.append(coord[0]) #repeat the first point to create a 'closed loop'

  buildingHeight = height
  date = datetime.now()
  lon = ln
  lat = lt

  allNewCoords = getNewCoords(coord, buildingHeight, date, lon, lat)


  i = 0

  xs, ys = zip(*coord) #create lists of x and y values
  ax.fill(xs, ys, edgecolor='orangered', linewidth=3)


  shadows = []
  for newCoords in allNewCoords:
    if (True):
      points = coord + newCoords
      multiPoints = MultiPoint(points)
      shadow = unary_union(triangulate(multiPoints))

      shadows.append(shadow)

  #shadows = splitPolygons(shadows[0], shadows[1], shadows[2])

  polygons = [Polygon(shadow) for shadow in shadows]

  for shadow in shadows:
      exterior_coords = shadow.exterior.xy

      ax.fill(*exterior_coords, color='black', alpha=0.2)  # Fill the polygon area
      ax.plot(*exterior_coords, color='black')  # Plot the exterior coordinates


  xs, ys = zip(*coord) #create lists of x and y values
  ax.fill(xs, ys, edgecolor='orangered', linewidth=3)

  plt.show() # if you need..
  plt.savefig("FINAL.PNG", bbox_inches='tight')
  
 # Shadows should be a list of polygons
def getNumOverlaps(x, y, shadows):
  overlaps = 0
  for shadow in shadows:
    if shadow.contains(Point(x, y)):
      overlaps += 1
  return overlaps
 
def overlapsToShadeLevel(overlaps):
  if (overlaps <= 1):
    return "FULL SUN"
  if (overlaps >= 5):
    return "FULL SHADE"
  return "PART SHADE"
  
